const authURL = "https://www.thingiverse.com/login/oauth/authorize";

const clientID = 'aa94d802db386b62e66e';

const clientSecret = 'afcfee0a90e3f8716c193909be317f72';

const appToken = 'c0e498769b974a60f892fb3da7646348';

module.exports = {
    authURL,
    clientID,
    clientSecret,
    appToken
}

// access_token: "972dc2c648711db0d397eda3072f22bc"
// Access token for test account
